#include <stdio.h>

void showField(/*const*/ int width,
               /*const*/ int height,
               /*const*/ int rocketLeftX,
               /*const*/ int rocketRightX,
               int rocketLeftCurY,
               int rocketRightCurY,
               int ballCurX,
               int ballCurY) {
  for (int i = 1; i <= height; ++i) {
    for (int j = 1; j <= width; ++j) {
      if ((j == rocketLeftX && i <= rocketLeftCurY + 1 && i >= rocketLeftCurY - 1) ||
         (j == rocketRightX && i <= rocketRightCurY + 1 && i >= rocketRightCurY - 1)){
        printf("|");
      } else {
        if (j == ballCurX && i == ballCurY) {
          printf("O");
        } else {
          printf("-");
        }
      }
    }
    printf("\n");
  }
}

void runGame(/*const*/ int width,
             /*const*/ int height,
             /*const*/ int rocketLeftBeginX,
             /*const*/ int rocketRightBeginX,
             /*const*/ int rocketLeftBeginY,
             /*const*/ int rocketRightBeginY,
             /*const*/ int ballBeginX,
             /*const*/ int ballBeginY,
             /*const*/ int directionBegin[2]) {
  //current possitions
  int scoreLeft = 0;
  int scoreRight = 0;
  int rocketLeftCurY = rocketLeftBeginY;
  int rocketRightCurY = rocketRightBeginY;
  int ballCurX = ballBeginX;
  int ballCurY = ballBeginY;
  int directionCur[2] = {directionBegin[0], directionBegin[1]};
  //input
  char input;
  //gameme number
  int number = 1;
  //game falg
  int flag = 1;
  //game loop
  while(flag){
    showField(width, height,
            rocketLeftBeginX,
            rocketRightBeginX,
            rocketLeftCurY,
            rocketRightCurY,
            ballCurX,
            ballCurY);
    scanf("%c", &input);
    getchar();
    switch (input) {
      case 'a':
        rocketLeftCurY -= rocketLeftCurY == 2 ? 0 : 1;
        break;
      case 'z':
        rocketLeftCurY += rocketLeftCurY == height - 1 ? 0 : 1;
        break;
      case 'k':
        rocketRightCurY -= rocketRightCurY == 2 ? 0 : 1;
        break;
      case 'm':
        rocketRightCurY += rocketRightCurY == height - 1 ? 0 : 1;
        break;
    }
    //ball logic
    ballCurX += directionCur[0];
    ballCurY += directionCur[1];
    if (ballCurX == rocketLeftBeginX && (ballCurY <= rocketLeftCurY + 1 && ballCurY >= rocketLeftCurY - 1) ||
        ballCurX == rocketRightBeginX && (ballCurY <= rocketRightCurY + 1 && ballCurY >= rocketRightCurY - 1)){
      ballCurX -= 2 * directionCur[0];
      ballCurY -= 2 * directionCur[1];
      directionCur[0] *= -1;
      directionCur[1] *= -1;
    } else {
      if (ballCurY == 0 || ballCurY == 26){
        ballCurY -= directionCur[1];
        directionCur[1] *= -1;
      } else {
        if (ballCurX == 1 || ballCurX == width) {
          scoreRight += ballCurX % width;
          scoreLeft += ballCurX / width;
          number *= -1;
          directionCur[0] = directionBegin[0] * number;
          directionCur[1] = directionBegin[1] * number;
          ballCurX = ballBeginX + number;
          ballCurY = ballBeginY;
          rocketLeftCurY = rocketRightCurY = rocketRightBeginY;
        } else {}
      }
    }
    if (scoreLeft == 21) {
      flag = 0;
      printf("Congratulations, Left player, you won!\n");
    }
    if (scoreRight == 21) {
      flag = 0;
      printf("Congratulations, Right player, you won!\n");
    }
  }
}

